package controller;

import albumModel.albummodel;
import org.springframework.stereotype.Controller;
import org.springframework.ui.Model;
import org.springframework.web.bind.annotation.GetMapping;

import java.util.ArrayList;
import java.util.List;


@Controller

public class albumControll {


    @GetMapping("/albums")
    public String getAlbumList(Model model) {
        List<albummodel> Albumss = new ArrayList<>();
        albummodel album1 = new albummodel("Friends That Break Your Heart" , "James Blake" ,11, 500 , "data:image/jpeg;base64," );
        albummodel album2 = new albummodel("Om Al Mawjat" , "synaptik" ,60, 1000 , "data:image/jpeg;base64," );
        albummodel album3= new albummodel("Hell Or High Water" , "Passenger" ,60, 1000 , "data:image/jpeg;base64," );
//        albummodel album4= new albummodel("Hell Or High Water" , "Passenger" ,60, 1000 , "data:image/jpeg;base64," );

        Albumss.add(album1);
        Albumss.add(album2);
        Albumss.add(album3);
        model.addAttribute("Albums" , Albumss);
        return "albums.html";
    }

}
